import React, { useState } from 'react';
import './Gallery.css';
import radImage from './galleryimages/rad.jpg';
import modal from 'react-modal'

export default function Gallery() {
  const [showModal, setShowModal] = useState(false);

  const toggleModal = () => {
    setShowModal(!showModal);
  };

  return (
    <div>
      <h1>Photo Gallery Grid</h1>
      <div className="photo-grid">
        <div className="card card-tall card-wide" onClick={toggleModal}>
          <img src={radImage} alt="Card 1" />
          <div className="overlay">
            <div className="overlay-text">1</div>
          </div>
        </div>
        <div className="card" onClick={toggleModal}>
          <img src="https://images.unsplash.com/photo-1583585635793-0e1894c169bd?ixlib=rb-1.2.1&auto=format&fit=crop&w=913&q=80" alt="Card 2" />
          <div className="overlay">
            <div className="overlay-text">2</div>
          </div>
        </div>
        <div className="card" onClick={toggleModal}>
          <img src="https://images.unsplash.com/photo-1583531172005-814191b8b6c0?ixlib=rb-1.2.1&auto=format&fit=crop&w=975&q=80" alt="Card 3" />
          <div className="overlay">
            <div className="overlay-text">3</div>
          </div>
        </div>
        {/* Add more cards as needed */}
      </div>

      {/* Modal */}
      {showModal && (
        <div className="modal" onClick={toggleModal}>
          <div className="modal-content">
            <img src={radImage} alt="Modal Image" />
          </div>
        </div>
      )}
    </div>
  );
}
